import React, { useState } from "react";
import { Card, CardHeader, CardBody, Row, Col, Button } from "reactstrap";
import jsPDF from "jspdf";

function Typography() {
  const [formData, setFormData] = useState({
    dropdownValue: "",
    dateTime: "",
    question: "",
  });

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: value,
    }));
  };

  const handleButtonClick = () => {
    // Generate PDF
    const doc = new jsPDF();
    doc.text(20, 20, `Dropdown Value: ${formData.dropdownValue}`);
    doc.text(20, 30, `Date Time: ${formData.dateTime}`);
    doc.text(20, 40, `Question: ${formData.question}`);
    doc.save("form_data.pdf");
  };

  return (
    <>
      <div className="content">
        <Row>
          <Col md="12">
            <Card>
              <CardHeader>
                <h5 className="title">Paper Table Heading</h5>
                <p className="category">Created using Montserrat Font Family</p>
              </CardHeader>
              <CardBody>
                <Row>
                  <Col md="4">
                    <div className="typography-line">
                      <h6>
                        <span>Dropdown</span>
                      </h6>
                      <select
                        name="dropdownValue"
                        value={formData.dropdownValue}
                        onChange={handleInputChange}
                      >
                        <option value="">Select...</option>
                        <option value="Option 1">Option 1</option>
                        <option value="Option 2">Option 2</option>
                        <option value="Option 3">Option 3</option>
                      </select>
                    </div>
                    <div className="typography-line">
                      <h6>
                        <span>Date Time</span>
                      </h6>
                      <input
                        type="datetime-local"
                        name="dateTime"
                        value={formData.dateTime}
                        onChange={handleInputChange}
                      />
                    </div>
                    <div className="typography-line">
                      <h6>
                        <span>Question</span>
                      </h6>
                      <textarea
                        name="question"
                        value={formData.question}
                        onChange={handleInputChange}
                      ></textarea>
                    </div>
                    <Button onClick={handleButtonClick}>Generate PDF</Button>
                  </Col>
                  <Col md="8">
                    {/* Your table code goes here */}
                    <div>
                      <h3>Table Goes Here</h3>
                      {/* Sample table */}
                      <table border="1">
                        <thead>
                          <tr>
                            <th>Column 1</th>
                            <th>Column 2</th>
                            <th>Column 3</th>
                          </tr>
                        </thead>
                        <tbody>
                          <tr>
                            <td>Data 1</td>
                            <td>Data 2</td>
                            <td>Data 3</td>
                          </tr>
                        </tbody>
                      </table>
                    </div>
                  </Col>
                </Row>
              </CardBody>
            </Card>
          </Col>
        </Row>
      </div>
    </>
  );
}

export default Typography;
